def minFlips(s):
    len_s = len(s)
    flips1 = 0
    flips2 = 0
    for i in range(len_s):
        if i % 2 == 0:
            expected1 = 0
            expected2 = 1
        else:
            expected1 = 1
            expected2 = 0
        if s[i] != expected1:
            flips1 += 1
        if s[i] != expected2:
            flips2 += 1
    return min(flips1, flips2)
